V8:
•	MELİSSA PARK  !  ГАЗИФИЦИРОВАННОЕ ПРЕСТИЖНОЕ ЗДАНИЕ !

•	В Ясамальском районе по адресу проспект Гасан-бека Зардаби. Всего 300 метров отделяют ее от станции метро «20 января». Рядом Тбилисский проспект, крупная транспортная развязка, что гарантирует комфортное передвижение по городу., в элитной заселенной новостройке MELİSSA PARK продается 2-х  комнатная квартира. Имеется ГАЗ . общая площадь по купчей 44 кв м . 17/9-й этаж,. Отличный ремонт,  после ремонта не жили. Порядка 70% придомовой территории занимает парк, где можно гулять, проводить время с детьми, заниматься спортом. Предусмотрены игровые детские и спортивные площадки, велодорожки, беседки для отдыха.. Соседи очень культурные городские люди. Газ, вода, свет постоянно . Жилой комплекс «Мелисса Парк» построен в той части города, где отлично развит сектор медицинских услуг. Недалеко от новостройки работают Республиканская клиническая больница им. Миргасымова, Республиканский онкологический центр, Научно-хирургический центр им. Топчубашева, детская больница, клиника им. Н. Туси. Образовательные учреждения рядом – Бакинский университет бизнеса, Медицинский колледж №2, Институт повышения квалификации врачей имени А. Алиева, школы №286, №159, детский сад Cahan. Торговая инфраструктура – гипермаркет Bravo, супермаркеты «Араз», «Нептун», магазин смешанных товаров Bazar. Для удобства и безопасности жильцов работают служба консьерж и специалисты охранного агентства, ведется видеонаблюдение.  Объекты собственной инфраструктуры:
•	Подземный паркинг;
•	Детский сад;
•	Гипермаркет;
•	Кафе и ресторан;
•	Фитнес-центр и Спа.

•	Yeni tikili Yasamal rayonunda, prospekt  Həsən bəy Zərdabi, ünvanında inşa olunmuşdur. Binanı «20 yanvar» metro stansiyasından cəmi 300 metr məsafə ayırır. Yaxınlıqda Tbilisi prospekti, şəhərdə gediş-gəlişin rahatlığına zəmanət verən böyük nəqliyyat mübadiləsi yerləşir. Yeni tikilmiş MELİSSA PARK yaşayış kompleksində 2 otaqlı   mənzil satılır . Mənzildə QAZ var. Ümumi sahəsi 44 kv.m.  17/9-cu mərtəbəsindədir, əla təmirli, təmirdən sonra yaşayış olmayıb. Təxminən 70% həyətyanı ərazinin sahəsini gəzməyə gedə biləcəyiniz, uşaqlarla vaxt keçirəcəyiniz, idmanla məşğul ola biləcəyiniz park sahəsi tutur. Uşaq və idman oyun meydançaları, velosiped yolları, istirahət üçün çardaqlı yerlər.. Yaşayış kompleksi «Melissa Parkı» şəhərin tibbi xidmət sektorunun əla inkişaf etdiyi hissəsində inşa olunmuşdur. Yeni tikilinin yaxınlığında Mirqasımova adına Respublika klinik xəstəxanası, Respublika onkoloji mərkəzi, Topçubaşova adına Elmi-cərrahiyyə mərkəzi, uşaq xəstəxanası, N. Tusi adına klinika fəaliyyət göstərir. Yaxınında yerləşən təhsil müəssisələri - Bakı biznes universiteti, Tibb kolleci, A. Əliyev adına 2 saylı həkimlərin ixtisaslaşdırma İnstitutu. 286, 159 saylı məktəblər, «Cahan» uşaq bağçası. Ticarət infrastrukturu – hipermarket «Bravo» supermarketlər, «Araz», «Neptun», qarışıq mallar mağazası «Bazar». Öz infrastrukturunun obyektləri:
•	Yeraltı parkinq;
•	Uşaq bağçası;
•	Hipermarket;
•	Kafe və restoran;
•	Fitness-mərkəzi, Spa.
•	Sakinlərin rahatlığı və təhlükəsizliyi üçün konsyerj xidməti və mühafizə agentliyinin mütəxəssisləri işləyir, videomüşahidə sistemi fəaliyyət göstərir.
